import random
import time


print("Herzlich Willkommen bei Philipp's Challenge!")
anzahl_der_fragen_richtig = 0


print("Frage 1: Wie heißt die Hauptstadt von Monaco?")
print("A: Gibraltar")
print("B: Monaco")
print("C: Vatikan")
player = input()


# elif ist entscheidend damit man immer nur eins von drei Fällen absolviert

if player == "C" or player == "c": # or bedeutet oder
    print("Richtig!") 
    anzahl_der_fragen_richtig = anzahl_der_fragen_richtig + 1

elif player == "B" or player == "b":
    print("Fast Richtig!")
else: # sonst
    print("Falsch")

print("Frage 2: Wie viel Wasser ist im Bodensee")
print("A: mehr als 60.000 m³.")
print("B: mehr als 50.000 m³.")
print("C: mehr als 40.000 m³.")
player = input()

if player == "C" or player == "c": # or bedeutet oder
    print("Richtig!") 
    anzahl_der_fragen_richtig = anzahl_der_fragen_richtig + 1

elif player == "B" or player == "b":
    print("Fast Richtig!")
else: # sonst
    print("Falsch")

print("Frage 3: Was ist ein Deutsches Word?")
print("A: Rindfleischetikettierungsüberwachungsaufgabenübertragungsgesetz.")
print("B: Rindfleischetikettierungsgesetz.")
print("C: Grundstücksverkehrsgenehmigungsübertragungsverordnung")
player = input()
if player == "A" or player == "a": # or bedeutet oder
    print("Richtig!") 
    anzahl_der_fragen_richtig = anzahl_der_fragen_richtig + 1

elif player == "B" or player == "b":
    print("Fast Richtig!")
else: # sonst
    print("Falsch")


print("Sie haben ", anzahl_der_fragen_richtig, " richtig beantwortet.")
time.sleep(1)
prozent_zahl = anzahl_der_fragen_richtig / 3 * 100
print("Sie haben {:.2f}% erzielt".format(prozent_zahl)) # Prozent mit nur 2 Nachkommastellen




